import React, { useState } from "react"
import { listJobs } from "../utils/api";




export const JobList = ({ jobs, data }) => {

  function loadJobs(){
    const abortController = new AbortController();

    listJobs(abortController.signal)
      .then(set)
  }
  if(jobs.length){
    return jobs.map((job, index) => {
        return (
          <>
            <ul >
              <li key={index}>
                <p>{job.neighborhood}</p>
                <p>{job.picture}</p>
                <p>{job.worker}</p>
                <p>{job.date}</p>
              </li>
            </ul>
          </>
        )
    })  
    }else{
      return(
        <div>
          <h4>No Jobs Listed</h4>
        </div>
      )
    }

}


export default JobList
